import { Route, Routes } from 'react-router-dom';
import './App.css';
import AddTransaction from './Components/addDetails';

function App() {
  return (
    <div className="App">
        <Routes>
          <Route path='/' element={<AddTransaction /> }/>
          <Route path='/fin/add' element={<AddTransaction /> }/>
        </Routes>
    </div>
  );
}

export default App;
